import React from "react";
import { firstName,lastName } from "./App";

const CompC = ()=>{
    return (
        <>
            <firstName.Consumer>
                {(fname)=>{
                    return (
                        <lastName.Consumer>
                            {(lname)=>{
                                return <h1>Hello {fname}, Your Full name is {fname} {lname}. right? </h1>;
                            }}
                        </lastName.Consumer>
                    )
                }}
            </firstName.Consumer>
        </>
    )
}
export default CompC;
